                </div>
                <hr />

                <div>
                    <h3 className="h3">Expense </h3>
                    <h3 className="h3">${getExpense()}</h3>
                </div>

                {/* <h3 className='income'>INCOME  200</h3>
                <h3>EXPENSE  100</h3> */}


                <h3>History</h3>
                <hr />
            </div>
        </div>
    )
}
